import React, { useState } from "react";
import './Register.css'
const Register = () => {
    const [firstName, newFirstName] = useState("");
    const [lastName, newLastName] = useState("");
    const [email, newEmail] = useState("");
    const [password, newPassword] = useState("");
    const [passwordConfirm, newPasswordConfirm] = useState("");
    return (
    <div className="Container">
        <h1>Register Your Account</h1>
        <form>
            <div className="first-name">
            <input 
            type='text' 
            placeholder="Enter First Name"
            value={firstName}
            onChange={newFirstName} 
            required>

            </input>
            </div>
            <div className="last-name">
            <input 
            type='text' 
            placeholder="Enter Last Name"
            value={lastName}
            onChange={newLastName}
            required>

            </input>
            </div>
            <div className="email-address">
                <input 
                type='email' 
                placeholder="Enter Email Address"
                value={email}
                onChange={newEmail}
                required></input>    
            </div>
            <div className="password-box1">
                <input 
                type='password' 
                placeholder="Enter Password"
                value={password}
                onChange={newPassword} 
                required></input>    
            </div>
            <div className="password-box2">
                <input 
                type='password' 
                placeholder="Re-enter Password"
                value={passwordConfirm}
                onChange={newPasswordConfirm}
                required></input>    
            </div>
            <div className="button">
                <button className="register-button" type="submit">
                    Register
                </button>
            </div>

        </form>
    </div>
    )
}
export default Register;
